### FILE: client/src/components/UserProfile.tsx

import React from 'react';

export interface User {
  avatar?: string;
  username: string;
  occupation?: string;
  bio?: string;
}

interface UserProfileProps {
  user: User;
  size?: number; // avatar size in pixels
}

const UserProfile: React.FC<UserProfileProps> = ({ user, size = 64 }) => {
  const { avatar, username, occupation, bio } = user;

  return (
    <div style={cardStyle}>
      <img
        src={avatar || 'https://via.placeholder.com/64'}
        alt={username}
        style={{ ...avatarStyle, width: size, height: size }}
      />
      <div style={contentStyle}>
        <div style={nameStyle}>{username}</div>
        {occupation && <div style={occupationStyle}>{occupation}</div>}
        {bio && <div style={bioStyle}>{bio}</div>}
      </div>
    </div>
  );
};

const cardStyle: React.CSSProperties = {
  display: 'flex',
  alignItems: 'center',
  padding: '12px',
  borderRadius: 12,
  boxShadow: '0 4px 12px rgba(0,0,0,0.08)',
  backgroundColor: '#fff',
  maxWidth: 420,
};

const avatarStyle: React.CSSProperties = {
  borderRadius: '50%',
  objectFit: 'cover',
  marginRight: 12,
  backgroundColor: '#eee',
};

const contentStyle: React.CSSProperties = {
  display: 'flex',
  flexDirection: 'column',
};

const nameStyle: React.CSSProperties = {
  fontSize: 18,
  fontWeight: 600,
  marginBottom: 4,
};

const occupationStyle: React.CSSProperties = {
  fontSize: 14,
  color: '#666',
  marginBottom: 6,
};

const bioStyle: React.CSSProperties = {
  fontSize: 13,
  color: '#555',
  lineHeight: 1.4,
  maxWidth: 320,
};

export default UserProfile;
### END_FILE
